import React from 'react';

class Login extends React.Component {
  constructor() {
    super();

    this.state = {
      emailInput: '',
      passwordInput: '',
    };
  }

  render() {
    const { emailInput, passwordInput } = this.state;

    return (
      <div>
        <input
          type="text"
          name="emailInput"
          placeholder="E-mail"
          data-testid="email-input"
        />

        <input
          type="password"
          placeholder="Senha"
          data-testid="password-input"
        />

        <button
          type="button"
          disabled
        >
          Entrar
        </button>
      </div>
    );
  }
}

export default Login;
